<head>
  <style>
    body {
      height: 320px;
    }
    .container {
      display: grid;
      font-family: Verdana, Geneva, Tahoma, sans-serif;
    }
    .card {
      width: 400px;
      border-radius: 15px;
      height: auto;
      display: flex;
      justify-content: center;
      box-shadow: rgba(100, 100, 111, 0.2) 0px 7px 29px 0px;
      background-color: #212121;
    }
    .party {
      width: 50%;
    }
    .party ul {
      list-style-type: none;
    }

    .party ul img {
      width: 40px;
    }

    .party ul li {
      color: white;
    }

    .party ul li div {
      padding: 1em;
      display: flex;
      align-items: center;
    }

    .dps {
    color: red;
  }
    
  </style>
</head>
